import React from "react";
import "./Footer.scss";
import "../../components/App/App.css";
// import trauma from "../../assets/img/trauma.png";
// import family from "../../assets/img/family.png";
// import child from "../../assets/img/child.png";


const Footer = () => {
    return (
        <div className="footer">
            <footer className="text-center text-lg-start text-muted">
                {/*<-- Section: Social media -->*/}
                <section
                    className="d-flex justify-content-center justify-content-lg-between p-4 border-bottom"
                >
                    {/*/!*!-- Left -->*!/*/}
                    {/*<div className="me-5 d-none d-lg-block">*/}
                    {/*    <span>Get connected with us on social networks:</span>*/}
                    {/*</div>*/}
                    {/*!-- Left -->*/}

                    {/*!-- Right -->*/}
                    {/*<div>*/}
                    {/*    <a href="" className="me-4 text-reset">*/}
                    {/*        <i className="fab fa-facebook-f"></i>*/}
                    {/*    </a>*/}
                    {/*    <a href="" className="me-4 text-reset">*/}
                    {/*        <i className="fab fa-twitter"></i>*/}
                    {/*    </a>*/}
                    {/*    <a href="" className="me-4 text-reset">*/}
                    {/*        <i className="fab fa-google"></i>*/}
                    {/*    </a>*/}
                    {/*    <a href="" className="me-4 text-reset">*/}
                    {/*        <i className="fab fa-instagram"></i>*/}
                    {/*    </a>*/}
                    {/*    <a href="" className="me-4 text-reset">*/}
                    {/*        <i className="fab fa-linkedin"></i>*/}
                    {/*    </a>*/}
                    {/*    <a href="" className="me-4 text-reset">*/}
                    {/*        <i className="fab fa-github"></i>*/}
                    {/*    </a>*/}
                    {/*</div>*/}
                    {/*!-- Right -->*/}
                </section>
                {/*!-- Section: Social media -->*/}

                {/*!-- Section: Links  -->*/}
                <section className="">
                    <div className="container text-center text-md-start mt-5">
                        {/*!-- Grid row -->*/}
                        <div className="row mt-3">
                            {/*!-- Grid column -->*/}
                            <div className="col-md-3 col-lg-4 col-xl-3 mx-auto mb-4">
                                {/*!-- Content -->*/}
                                <h6 className="text-uppercase fw-bold mb-4">
                                    <i className="fas fa-gem me-3">Company name</i>
                                </h6>
                                <p>
                                    Here you can use rows and columns to organize your footer content. Lorem ipsum
                                    dolor sit amet, consectetur adipisicing elit.
                                </p>
                            </div>
                            {/*!-- Grid column -->*/}

                            {/*!-- Grid column -->*/}
                            <div className="col-md-2 col-lg-2 col-xl-2 mx-auto mb-4">
                                {/*!-- Links -->*/}
                                <h6 className="text-uppercase fw-bold mb-4">
                                    Products
                                </h6>
                                <p>
                                    <a href="#!" className="text-reset">Angular</a>
                                </p>
                                <p>
                                    <a href="#!" className="text-reset">React</a>
                                </p>
                                <p>
                                    <a href="#!" className="text-reset">Vue</a>
                                </p>
                                <p>
                                    <a href="#!" className="text-reset">Laravel</a>
                                </p>
                            </div>
                            {/*!-- Grid column -->*/}

                            {/*!-- Grid column -->*/}
                            <div className="col-md-3 col-lg-2 col-xl-2 mx-auto mb-4">
                                {/*!-- Links -->*/}
                                <h6 className="text-uppercase fw-bold mb-4">
                                    Useful links
                                </h6>
                                <p>
                                    <a href="#!" className="text-reset">Pricing</a>
                                </p>
                                <p>
                                    <a href="#!" className="text-reset">Settings</a>
                                </p>
                                <p>
                                    <a href="#!" className="text-reset">Orders</a>
                                </p>
                                <p>
                                    <a href="#!" className="text-reset">Help</a>
                                </p>
                            </div>
                            {/*!-- Grid column -->*/}

                            {/*!-- Grid column -->*/}
                            <div className="col-md-4 col-lg-3 col-xl-3 mx-auto mb-md-0 mb-4">
                                {/*!-- Links -->*/}
                                <h6 className="footer-header mb-4">
                                    Контакти
                                </h6>
                                <p><i className="text-style">вул. Чистяківська, 7/75, Київ, 06062, Україна</i></p>
                                <p><i className="text-style">apsyct@gmail.com</i></p>
                                <p><i className="text-style">+38 097 750 22 57</i></p>
                            </div>
                            {/*!-- Grid column -->*/}
                        </div>
                        {/*!-- Grid row -->*/}
                    </div>
                </section>
                {/*!-- Section: Links  -->*/}

                {/*!-- Copyright -->*/}
                <div className="text-center p-4">
                    © 2021 Copyright:
                    <a className="text-reset fw-bold" href="https://mdbootstrap.com/">MDBootstrap.com</a>
                </div>
                {/*!-- Copyright -->*/}
            </footer>
        </div>
    )
};

export default Footer;
